    return (
        <View style={styles.card}>
          <Text style={styles.cardTitle}>Categorias         </Text>
          <Text style={styles.cardSubtitle}>LCD, LED, PLASMA         </Text>
          <Text style={styles.cardSubtitle2}>Selecione Uma Categoria         </Text>
      </View>
    )

}

const styles = StyleSheet.create({

    card: {
      backgroundColor:'#FFF',
